import {  StyleSheet, Text, View } from 'react-native';


const styles = StyleSheet.create({
    container: {
      flex: 8,
      backgroundColor: '#cdcdcd',
    },



    header: {
      padding: 10,
      textAlign: 'center',
      
    },
    header_text: {
      color: 'red',
      textAlign: 'center',
      
    },




    content: {
      justifyContent: 'center',
      alignItems: 'center',
      
    },
    content_text: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 100,
      
    },
    content_button: {
      width: 100,
      height: 40,
      backgroundColor: 'red',
      padding: 10,
      borderRadius: 12,
      justifyContent: 'center',
      alignItems: 'center',
      margin: 'auto',
    },





    footer: {
      justifyContent: 'flex-end',
      alignItems: 'center',
      
    },
    footer_text: {
      height: 40,
      color: 'red',
      textAlign: 'center',
      
    },
  });


export { styles };
